from iea import omrfrom dotenv import load_dotenvfrom os import getenv# Load environmental variables from '.env' file.load_dotenv()colorder = [    'Demand',    'OECD',    'Non-OECD',    'Non-OPEC supply',    'North America',    'FSU',    'OPEC NGLs/Condensates',    'OPEC crude',    'Stock change']def balance_comparisons():    iea = omr.comparable_snd_table(omr_zip_loc=getenv("IEA_OMR_LOC"))[colorder]    res = {        'iea' : iea    }    return resif __name__ == '__main__':    balance_comparisons()